#include<stdio.h>
#include<math.h>
#include<vector>
using namespace std;

float mean_absolute_deviation(vector<float> numbers) {
    float sum = 0.0;
    int n = numbers.size();

    // Calculate the mean
    for (float num : numbers) {
        sum += num;
    }
    float mean = sum / n;

    // Calculate the Mean Absolute Deviation
    float mad_sum = 0.0;
    for (float num : numbers) {
        mad_sum += fabs(num - mean);
    }

    return mad_sum / n; // Return the average of absolute deviations
}

