#include<string>
#include<sstream>
using namespace std;

vector<int> parse_music(string music_string) {
    vector<int> beats;
    stringstream ss(music_string);
    string note;

    while (ss >> note) {
        if (note == "o") {
            beats.push_back(4); // whole note
        } else if (note == "o|") {
            beats.push_back(2); // half note
        } else if (note == ".|") {
            beats.push_back(1); // quarter note
        }
    }

    return beats;
}

