int how_many_times(string str, string substring) {
    if (substring.empty() || str.empty()) {
        return 0;
    }

    int count = 0;
    size_t pos = str.find(substring);

    while (pos != string::npos) {
        count++;
        pos = str.find(substring, pos + 1); // Move to the next position to allow overlapping
    }

    return count;
}

