vector<int> factorize(int n) {
    vector<int> factors;
    // Start with the smallest prime factor
    for (int i = 2; i * i <= n; i++) {
        while (n % i == 0) {
            factors.push_back(i);
            n /= i;
        }
    }
    // If n is still greater than 1, then it is a prime factor
    if (n > 1) {
        factors.push_back(n);
    }
    return factors;
}

