    while (n % 2 == 0) {
        factors.push_back(2);
        n /= 2;
    }
    // n must be odd at this point, so we can skip even numbers
    for (int i = 3; i * i <= n; i += 2) {
        // While i divides n, add i and divide n
        while (n % i == 0) {
            factors.push_back(i);
            n /= i;
        }
    }
    // This condition is to check if n is a prime number greater than 2
