using namespace std;

string sort_numbers(string numbers) {
    // Map to convert string representations of numbers to their corresponding integer values
    map<string, int> num_map = {
        {"zero", 0}, {"one", 1}, {"two", 2}, {"three", 3},
        {"four", 4}, {"five", 5}, {"six", 6}, {"seven", 7},
        {"eight", 8}, {"nine", 9}
    };

    // Split the input string into words
    stringstream ss(numbers);
    vector<string> num_words;
    string word;

    while (ss >> word) {
        num_words.push_back(word);
    }

    // Sort the words based on their integer values
    sort(num_words.begin(), num_words.end(), [&](const string &a, const string &b) {
        return num_map[a] < num_map[b];
    });

    // Join the sorted words back into a single string
    string result;
    for (const string &num : num_words) {
        if (!result.empty()) {
            result += " ";
        }
        result += num;
    }

    return result;
}

