// Function to check if a number is prime
bool is_prime(int num) {
    if (num <= 1) return false;
    if (num <= 3) return true;
    if (num % 2 == 0 || num % 3 == 0) return false;
    for (int i = 5; i * i <= num; i += 6) {
        if (num % i == 0 || num % (i + 2) == 0) return false;
    }
    return true;
}

// Function to return the n-th Fibonacci number that is also prime
int prime_fib(int n) {
    vector<int> fibs = {0, 1}; // Starting Fibonacci numbers
    vector<int> prime_fibs; // To store prime Fibonacci numbers

    // Generate Fibonacci numbers and check for primes
    while (prime_fibs.size() < n) {
        int next_fib = fibs[fibs.size() - 1] + fibs[fibs.size() - 2];
        fibs.push_back(next_fib);

        // Check if the Fibonacci number is prime
        if (is_prime(next_fib)) {
            prime_fibs.push_back(next_fib);
        }
    }

    // Return the n-th prime Fibonacci number
    return prime_fibs[n - 1];
}

