string encode_cyclic(string s){ 
    // returns encoded string by cycling groups of three characters.  
    // split string to groups. Each of length 3.
    int l=s.length();
    int num=(l+2)/3;
    string x,output;
    int i;
    for (i=0;i*3<l;i++)
    {
        //cycle elements in each group. Unless group has fewer elements than 3.
        x=s.substr(i*3,3);
        if (x.length()==3) x=x.substr(1)+x[0];
        output=output+x;
    }
    return output;
}

string decode_cyclic(string s){ 
    /*
    takes as input string encoded with encode_cyclic function. Returns decoded string. 
    */
    int l = s.length();
    string output;
    int i;
    for (i = 0; i * 3 < l; i++)
    {
        // Get the current group of three characters
        string x = s.substr(i * 3, 3);
        if (x.length() == 3) {
            // Shift the last character to the front
            output += x[2]; // last character
            output += x.substr(0, 2); // first two characters
        } else {
            // If the group has fewer than 3 characters, just append it
            output += x;
        }
    }
    return output;
}

