string change_base(int x, int base) {
    if (base < 2 || base >= 10) {
        return ""; // Invalid base
    }

    string result = "";
    do {
        int remainder = x % base;
        result = to_string(remainder) + result; // Prepend the remainder
        x /= base;
    } while (x > 0);

    return result;
}

#undef NDEBUG
