#include<stdio.h>
using namespace std;

int modp(int n, int p) {
    if (n == 0) return 1; // 2^0 is 1
    long long result = 1; // Use long long to avoid overflow
    long long base = 2; // Base is 2

    // Calculate 2^n % p using iterative method
    while (n > 0) {
        if (n % 2 == 1) { // If n is odd
            result = (result * base) % p;
        }
        base = (base * base) % p; // Square the base
        n /= 2; // Divide n by 2
    }

    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (modp(3, 5) == 3);
    assert (modp(1101, 101) == 2);
    assert (modp(0, 101) == 1);
    assert (modp(3, 11) == 8);
    assert (modp(100, 101) == 1);
    assert (modp(30, 5) == 4);
    assert (modp(31, 5) == 3);
}

