#include <queue>
#include <bits/stdc++.h>

#include<stdio.h>
#include<string>
using namespace std;

string encode_shift(string s){
    // returns encoded string by shifting every character by 5 in the alphabet.
    string out;
    int i;
    for (i=0; i<s.length(); i++)
    {
        int w = ((int)s[i] + 5 - (int)'a') % 26 + (int)'a';   
        out = out + (char)w;
    }
    return out;
}

string decode_shift(string s){
    // takes as input string encoded with encode_shift function. Returns decoded string.
    string out;
    int i;
    for (i=0; i<s.length(); i++)
    {
        int w = ((int)s[i] - 5 - (int)'a' + 26) % 26 + (int)'a'; // Adding 26 to ensure non-negative result
        out = out + (char)w;
    }
    return out;
}

#undef NDEBUG
#include<assert.h>
int main(){

    for (int i=0;i<100;i++)
    {
        int l=10+rand()%11;
        string str="";
        for (int j=0;j<l;j++)
        {
            char chr=97+rand()%26;
            str+=chr;
        }

        string encoded_str = encode_shift(str);
        assert (decode_shift(encoded_str) == str);
    }
}

