bool correct_bracketing(string brackets) {
    int balance = 0; // To keep track of the balance of brackets
    for (char ch : brackets) {
        if (ch == '<') {
            balance++; // Increment for opening bracket
        } else if (ch == '>') {
            balance--; // Decrement for closing bracket
        }
        // If at any point balance goes negative, it means there's a closing bracket without a matching opening bracket
        if (balance < 0) {
            return false;
        }
    }
    // At the end, balance should be zero for all opening brackets to be matched
    return balance == 0;
}

