#include<stdio.h>
#include<string>
using namespace std;

bool correct_bracketing(string brackets) {
    int balance = 0; // To keep track of the balance of brackets
    for (char ch : brackets) {
        if (ch == '(') {
            balance++; // Increment for an opening bracket
        } else if (ch == ')') {
            balance--; // Decrement for a closing bracket
        }
        // If balance goes negative, it means there's a closing bracket without a matching opening bracket
        if (balance < 0) {
            return false;
        }
    }
    // At the end, balance should be zero for all brackets to be matched
    return balance == 0;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (correct_bracketing("()"));
    assert (correct_bracketing("(()())"));
    assert (correct_bracketing("()()(()())()"));
    assert (correct_bracketing("()()((()()())())(()()(()))"));
    assert (not (correct_bracketing("((()())))")));
    assert (not (correct_bracketing(")(()")));
    assert (not (correct_bracketing("(")));
    assert (not (correct_bracketing("((((")));
    assert (not (correct_bracketing(")")));
    assert (not (correct_bracketing("(()")));
    assert (not (correct_bracketing("()()(()())())(()")));
    assert (not (correct_bracketing("()()(()())()))()")));
}

