vector<int> strange_sort_list(vector<int> lst) {
    vector<int> result;
    if (lst.empty()) {
        return result; // Return empty if input is empty
    }

    // Sort the input list
    sort(lst.begin(), lst.end());

    // Use two pointers to pick elements from both ends
    int left = 0;
    int right = lst.size() - 1;

    // Alternate between the smallest and largest remaining elements
    while (left <= right) {
        if (left == right) {
            result.push_back(lst[left]); // Add the last remaining element
        } else {
            result.push_back(lst[left]); // Add the smallest
            result.push_back(lst[right]); // Add the largest
        }
        left++;
        right--;
    }

    return result;
}

