    for (int i = 2; i * i <= num; i++) {
        if (num % i == 0) return false;
    }
    return true;
}

bool is_multiply_prime(int a) {
    vector<int> primes;
    // Collect all prime numbers less than 100
    for (int i = 2; i < 100; i++) {
        if (is_prime(i)) {
            primes.push_back(i);
        }
    }

    // Check for combinations of three primes
    int n = primes.size();
    for (int i = 0; i < n; i++) {
        for (int j = i; j < n; j++) {
