#include<stdio.h>
#include<string>
using namespace std;

string solve(int N) {
    int sum = 0;

    // Calculate the sum of digits
    while (N > 0) {
        sum += N % 10; // Add the last digit to sum
        N /= 10;       // Remove the last digit
    }

    // Convert the sum to binary
    string binary = "";
    if (sum == 0) {
        return "0"; // Handle the case where the sum is 0
    }

    while (sum > 0) {
        binary = to_string(sum % 2) + binary; // Prepend the binary digit
        sum /= 2; // Divide by 2 to get the next digit
    }

    return binary; // Return the binary representation of the sum
}

#undef NDEBUG
#include<assert.h>
