using namespace std;

vector<string> numerical_letter_grade(vector<float> grades) {
    vector<string> letterGrades;

    for (float gpa : grades) {
        if (gpa == 4.0) {
            letterGrades.push_back("A+");
        } else if (gpa > 3.7) {
            letterGrades.push_back("A");
        } else if (gpa > 3.3) {
            letterGrades.push_back("A-");
        } else if (gpa > 3.0) {
            letterGrades.push_back("B+");
        } else if (gpa > 2.7) {
            letterGrades.push_back("B");
        } else if (gpa > 2.3) {
            letterGrades.push_back("B-");
        } else if (gpa > 2.0) {
            letterGrades.push_back("C+");
        } else if (gpa > 1.7) {
            letterGrades.push_back("C");
        } else if (gpa > 1.3) {
            letterGrades.push_back("C-");
        } else if (gpa > 1.0) {
            letterGrades.push_back("D+");
        } else if (gpa > 0.7) {
            letterGrades.push_back("D");
        } else if (gpa > 0.0) {
            letterGrades.push_back("D-");
        } else {
            letterGrades.push_back("E");
        }
    }

    return letterGrades;
}

#undef NDEBUG
#include<assert.h>
bool issame(vector<string> a,vector<string>b){
    if (a.size()!=b.size()) return false;
    for (int i=0;i<a.size();i++)
    {
    if (a[i]!=b[i]) return false;
    }
    return true;
}
int main(){
    assert (issame(numerical_letter_grade({4.0, 3, 1.7, 2, 3.5}) , {"A+", "B", "C-", "C", "A-"}));
    assert (issame(numerical_letter_grade({1.2}) , {"D+"}));
    assert (issame(numerical_letter_grade({0.5}) , {"D-"}));
    assert (issame(numerical_letter_grade({0.0}) , {"E"}));
    assert (issame(numerical_letter_grade({1, 0.3, 1.5, 2.8, 3.3}) , {"D", "D-", "C-", "B", "B+"}));
    assert (issame(numerical_letter_grade({0, 0.7}) , {"E", "D-"}));

}

