int starts_one_ends(int n) {
    if (n <= 0) return 0; // Handle invalid input

    // Count of n-digit numbers that start with 1
    int start_with_one = 1; // The first digit is fixed as 1
    // The remaining (n-1) digits can be anything from 0 to 9
    if (n > 1) {
        start_with_one *= 9 * pow(10, n - 2); // 9 choices for the second digit (2-9) and 10 choices for the rest
    }

    // Count of n-digit numbers that end with 1
    int end_with_one = 9 * pow(10, n - 1); // 9 choices for the first digit (1-9) and 1 choice for the last digit (1)

    // If n > 1, we have counted the numbers that both start and end with 1 twice
    int both_start_and_end_with_one = 1; // Only the number '11' for n = 2
    if (n > 2) {
        both_start_and_end_with_one = pow(10, n - 2); // 10^(n-2) choices for the middle digits
    }

    // Total count
    return start_with_one + end_with_one - both_start_and_end_with_one;
}

