#include<stdio.h>
#include<string>
#include<algorithm>
using namespace std;

string anti_shuffle(string s) {
    string result = "";
    string currentWord = "";

    for (char c : s) {
        if (c == ' ') {
            // If we encounter a space, sort the current word and add it to the result
            if (!currentWord.empty()) {
                sort(currentWord.begin(), currentWord.end());
                result += currentWord;
                currentWord = "";
            }
            result += ' '; // Add the space to the result
        } else {
            currentWord += c; // Build the current word
        }
    }

    // Sort and add the last word if it exists
    if (!currentWord.empty()) {
        sort(currentWord.begin(), currentWord.end());
        result += currentWord;
    }

    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (anti_shuffle("Hi") == "Hi");
    assert (anti_shuffle("hello") == "ehllo");
    assert (anti_shuffle("number") == "bemnru");
    assert (anti_shuffle("abcd") == "abcd");
    assert (anti_shuffle("Hello World!!!") == "Hello !!!Wdlor");
    assert (anti_shuffle("") == "");
    assert (anti_shuffle("Hi. My name is Mister Robot. How are you?") == ".Hi My aemn is Meirst .Rboot How aer ?ouy");
}

