    int lower = floor(number);    // Get the lower integer
    int upper = ceil(number);     // Get the upper integer

    // Check the distance from the number to the lower and upper integers
    double distanceToLower = abs(number - lower);
    double distanceToUpper = abs(number - upper);

    // If the distances are equal, round away from zero
    if (distanceToLower == distanceToUpper) {
        if (number > 0) {
            return upper; // Round up for positive numbers
        } else {
            return lower; // Round down for negative numbers
