long long minSubArraySum(vector<long long> nums) {
    long long minSum = nums[0];
    long long currentSum = 0;

    for (long long num : nums) {
        currentSum += num;
        if (currentSum < minSum) {
            minSum = currentSum;
        }
        if (currentSum > 0) {
            currentSum = 0; // Reset current sum if it becomes positive
        }
    }

    return minSum;
}

