string match_parens(vector<string> lst) {
    string s1 = lst[0];
    string s2 = lst[1];

    // Function to count the balance of parentheses
    auto countBalance = [](const string& s) {
        int balance = 0;
        for (char c : s) {
            if (c == '(') {
                balance++;
            } else {
                balance--;
            }
        }
        return balance;
    };

    // Count balance for both strings
    int balance1 = countBalance(s1);
    int balance2 = countBalance(s2);

    // Check if concatenating in both orders can result in a good string
    // Concatenating s1 then s2
    if (balance1 + balance2 == 0) {
        return "Yes";
    }

    // Concatenating s2 then s1
    if (balance2 + balance1 == 0) {
        return "Yes";
    }

    // Check if we can balance the parentheses
    int open1 = count(s1.begin(), s1.end(), '(');
    int close1 = count(s1.begin(), s1.end(), ')');
    int open2 = count(s2.begin(), s2.end(), '(');
    int close2 = count(s2.begin(), s2.end(), ')');

    // Check if we can balance the parentheses by checking the counts
    if (open1 + open2 >= close1 + close2 && close1 + close2 >= open1 + open2) {
        return "Yes";
    }

    return "No";
}

