vector<string> select_words(string s, int n) {
    vector<string> result;
    string word;

    // Split the string into words
    for (char c : s) {
        if (c == ' ') {
            if (!word.empty()) {
                // Count consonants in the word
                int consonant_count = 0;
                for (char ch : word) {
                    if (isalpha(ch) && !strchr("aeiouAEIOU", ch)) {
                        consonant_count++;
                    }
                }
                // Check if the word has exactly n consonants
                if (consonant_count == n) {
                    result.push_back(word);
                }
                word.clear(); // Clear the word for the next one
            }
        } else {
            word += c; // Build the current word
        }
    }

    // Check the last word if there is no trailing space
    if (!word.empty()) {
        int consonant_count = 0;
        for (char ch : word) {
            if (isalpha(ch) && !strchr("aeiouAEIOU", ch)) {
                consonant_count++;
            }
        }
        if (consonant_count == n) {
            result.push_back(word);
        }
    }

    return result;
}

