#include<stdio.h>
#include<math.h>
#include<vector>
using namespace std;

int prod_signs(vector<int> arr) {
    if (arr.empty()) {
        return -32768; // Return -32768 for empty array
    }

    int sum_magnitudes = 0;
    int product_sign = 1; // Start with a neutral product sign

    for (int num : arr) {
        if (num > 0) {
            sum_magnitudes += num; // Add magnitude of positive numbers
        } else if (num < 0) {
            sum_magnitudes += -num; // Add magnitude of negative numbers
            product_sign *= -1; // Flip the sign for negative numbers
        } else {
            product_sign = 0; // If there's a zero, the product sign becomes zero
            break; // No need to continue if we have a zero
        }
    }

    return sum_magnitudes * product_sign; // Return the final result
}

