            product *= digit; // Multiply the product by the odd digit
            hasOdd = true; // Mark that we have at least one odd digit
        }
        n /= 10; // Remove the last digit
    }

    return hasOdd ? product : 0; // Return product if there's at least one odd digit, otherwise return 0
}

