bool is_nested(string str) {
    int balance = 0; // To track the balance of brackets
    bool hasNested = false; // To check if there is any nested bracket

    for (char ch : str) {
        if (ch == '[') {
            balance++;
            // If we have more than one open bracket, we have a nested structure
            if (balance > 1) {
                hasNested = true;
            }
        } else if (ch == ']') {
            balance--;
            // If balance goes negative, it means there are unmatched closing brackets
            if (balance < 0) {
                return false;
            }
        }
    }

    // Valid if balance is zero (all brackets matched) and hasNested is true
    return balance == 0 && hasNested;
}

