void dfs(vector<vector<int>>& grid, int x, int y, int k, vector<int>& currentPath, vector<int>& minPath) {
    // If we have reached the desired path length
    if (currentPath.size() == k) {
        if (minPath.empty() || currentPath < minPath) {
            minPath = currentPath; // Update the minimum path
        }
        return;
    }

    // Directions for moving up, down, left, right
    vector<pair<int, int>> directions = {{1, 0}, {-1, 0}, {0, 1}, {0, -1}};

    // Explore neighbors
    for (auto& dir : directions) {
        int newX = x + dir.first;
        int newY = y + dir.second;

        // Check if the new position is within bounds
        if (newX >= 0 && newX < grid.size() && newY >= 0 && newY < grid[0].size()) {
            currentPath.push_back(grid[newX][newY]); // Add the value to the current path
            dfs(grid, newX, newY, k, currentPath, minPath); // Recursive DFS call
            currentPath.pop_back(); // Backtrack
        }
    }
}

vector<int> minPath(vector<vector<int>> grid, int k) {
    vector<int> minPath; // To store the minimum path found
    int n = grid.size();

    // Try starting from each cell in the grid
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < n; ++j) {
            vector<int> currentPath = {grid[i][j]}; // Start path with the current cell
            dfs(grid, i, j, k, currentPath, minPath); // Start DFS from the current cell
        }
    }

    return minPath; // Return the minimum path found
}

