void dfs(vector<vector<int>>& grid, int x, int y, int k, vector<int>& path, vector<int>& bestPath) {
    // If we have reached the desired path length
    if (path.size() == k) {
        // Compare with the best path found so far
        if (bestPath.empty() || path < bestPath) {
            bestPath = path; // Update the best path
        }
        return;
    }

    // Directions for moving in the grid (up, down, left, right)
    vector<pair<int, int>> directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};

    // Explore all possible directions
    for (auto& dir : directions) {
        int newX = x + dir.first;
        int newY = y + dir.second;

        // Check if the new position is within the grid bounds
        if (newX >= 0 && newX < grid.size() && newY >= 0 && newY < grid[0].size()) {
            path.push_back(grid[newX][newY]); // Add the new cell value to the path
            dfs(grid, newX, newY, k, path, bestPath); // Recur for the new cell
            path.pop_back(); // Backtrack
        }
    }
}

vector<int> minPath(vector<vector<int>> grid, int k) {
    vector<int> bestPath; // To store the best path found
    int n = grid.size();

    // Try starting from each cell in the grid
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            vector<int> path = {grid[i][j]}; // Start path with the current cell
            dfs(grid, i, j, k, path, bestPath); // Perform DFS from the current cell
        }
    }

    return bestPath; // Return the best path found
}

