bool simplify(string x, string n) {
    // Split the fractions into numerator and denominator
    int numX, denX, numN, denN;
    char slash;

    // Parse the first fraction x
    stringstream ssX(x);
    ssX >> numX >> slash >> denX;

    // Parse the second fraction n
    stringstream ssN(n);
    ssN >> numN >> slash >> denN;

