// Function to calculate the sum of digits of a number
int digit_sum(int num) {
    int sum = 0;
    // Handle negative numbers by taking the absolute value
    num = abs(num);
    while (num > 0) {
        sum += num % 10;
        num /= 10;
    }
    return sum;
}

// Function to sort the vector based on the sum of digits
vector<int> order_by_points(vector<int> nums) {
    // Create a vector of pairs to store the original index along with the number
    vector<pair<int, int>> indexed_nums;
    for (int i = 0; i < nums.size(); i++) {
        indexed_nums.push_back({nums[i], i});
    }

    // Sort the vector based on the sum of digits and original index
    sort(indexed_nums.begin(), indexed_nums.end(), [](const pair<int, int>& a, const pair<int, int>& b) {
        int sum_a = digit_sum(a.first);
        int sum_b = digit_sum(b.first);
        // If sums are equal, sort by original index
        if (sum_a == sum_b) {
            return a.second < b.second;
        }
        return sum_a < sum_b;
    });

    // Extract the sorted numbers into a result vector
    vector<int> result;
    for (const auto& p : indexed_nums) {
        result.push_back(p.first);
    }

    return result;
}

