// Function to calculate the sum of digits of a number
int digit_sum(int num) {
    int sum = 0;
    bool isNegative = num < 0; // Check if the number is negative
    num = abs(num); // Work with the absolute value of the number

    while (num > 0) {
        sum += num % 10; // Add the last digit to the sum
        num /= 10; // Remove the last digit
    }

    // If the number was negative, we consider the first digit as negative
    return isNegative ? -sum : sum;
}

// Comparator function to sort based on digit sum and original index
bool compare(const pair<int, int>& a, const pair<int, int>& b) {
    if (a.first != b.first) {
        return a.first < b.first; // Compare digit sums
    }
    return a.second < b.second; // Compare original indices if digit sums are equal
}

vector<int> order_by_points(vector<int> nums) {
    vector<pair<int, int>> digitSums; // Pair to hold digit sum and original index

    // Fill the vector with digit sums and original indices
    for (int i = 0; i < nums.size(); i++) {
        digitSums.push_back({digit_sum(nums[i]), i});
    }

    // Sort based on the custom comparator
    sort(digitSums.begin(), digitSums.end(), compare);

    // Create the output vector based on the sorted order
    vector<int> sortedNums;
    for (const auto& p : digitSums) {
        sortedNums.push_back(nums[p.second]);
    }

    return sortedNums;
}

