vector<string> bf(string planet1, string planet2) {
    vector<string> planets = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};

    // Check if the input planets are valid
    auto it1 = find(planets.begin(), planets.end(), planet1);
    auto it2 = find(planets.begin(), planets.end(), planet2);

    if (it1 == planets.end() || it2 == planets.end()) {
        return {}; // Return empty vector if either planet is invalid
    }

    // Get the indices of the planets
    int index1 = distance(planets.begin(), it1);
    int index2 = distance(planets.begin(), it2);

    // Ensure index1 is less than index2
    if (index1 > index2) {
        swap(index1, index2);
    }

    // Collect planets between planet1 and planet2
    vector<string> result;
    for (int i = index1 + 1; i < index2; i++) {
        result.push_back(planets[i]);
    }

    return result;
}

