#include<algorithm>
using namespace std;

vector<string> bf(string planet1, string planet2) {
    vector<string> planets = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};

    // Find the indices of the given planets
    auto it1 = find(planets.begin(), planets.end(), planet1);
    auto it2 = find(planets.begin(), planets.end(), planet2);

    // Check if both planets are valid
    if (it1 == planets.end() || it2 == planets.end()) {
        return {}; // Return empty vector if either planet is invalid
    }

    // Get the indices of the planets
    int index1 = distance(planets.begin(), it1);
    int index2 = distance(planets.begin(), it2);

    // Ensure index1 is less than index2
    if (index1 > index2) {
        swap(index1, index2);
    }

    // Collect planets between the two indices
    vector<string> result;
    for (int i = index1 + 1; i < index2; i++) {
        result.push_back(planets[i]);
    }

    return result;
}

#undef NDEBUG
#include<assert.h>
bool issame(vector<string> a,vector<string>b){
    if (a.size()!=b.size()) return false;
    for (int i=0;i<a.size();i++)
    {
    if (a[i]!=b[i]) return false;
    }
    return true;
}
int main(){
    assert (issame(bf("Jupiter", "Neptune") , {"Saturn", "Uranus"}));
    assert (issame(bf("Earth", "Mercury") , {"Venus",}));
    assert (issame(bf("Mercury", "Uranus") , {"Venus", "Earth", "Mars", "Jupiter", "Saturn"}));
    assert (issame(bf("Neptune", "Venus") , {"Earth", "Mars", "Jupiter", "Saturn", "Uranus"}));
    assert (issame(bf("Earth", "Earth") , {}));
    assert (issame(bf("Mars", "Earth") , {}));
    assert (issame(bf("Jupiter", "Makemake") , {}));
}

