#include<stdio.h>
#include<vector>
using namespace std;

int get_max_triples(int n) {
    vector<int> a(n);
    // Fill the vector a with the given formula
    for (int i = 1; i <= n; i++) {
        a[i - 1] = i * i - i + 1;
    }

    int count = 0;

    // Check all combinations of triples (i, j, k) where i < j < k
    for (int i = 0; i < n - 2; i++) {
        for (int j = i + 1; j < n - 1; j++) {
            for (int k = j + 1; k < n; k++) {
                if ((a[i] + a[j] + a[k]) % 3 == 0) {
                    count++;
                }
            }
        }
    }

    return count;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (get_max_triples(5) == 1);
    assert (get_max_triples(6) == 4);
    assert (get_max_triples(10) == 36);
    assert (get_max_triples(100) == 53361);
}

