#include<stdio.h>
#include<string>
using namespace std;

bool cycpattern_check(string a, string b) {
    // Check if b is longer than a, if so it can't be a substring
    if (b.length() > a.length()) {
        return false;
    }

    // Create a new string that is the concatenation of b with itself
    string b_rotated = b + b;

    // Check if b or any of its rotations is a substring of a
    return b_rotated.find(a) != string::npos;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert  (cycpattern_check("xyzw","xyw") == false );
    assert  (cycpattern_check("yello","ell") == true );
    assert  (cycpattern_check("whattup","ptut") == false );
    assert  (cycpattern_check("efef","fee") == true );
    assert  (cycpattern_check("abab","aabb") == false );
    assert  (cycpattern_check("winemtt","tinem") == true );
}

