vector<int> even_odd_count(int num) {
    vector<int> count(2, 0); // count[0] for even, count[1] for odd
    num = abs(num); // Consider absolute value to handle negative numbers

    while (num > 0) {
        int digit = num % 10; // Get the last digit
        if (digit % 2 == 0) {
            count[0]++; // Increment even count
        } else {
            count[1]++; // Increment odd count
        }
        num /= 10; // Remove the last digit
    }

    return count;
}

