vector<int> eat(int number, int need, int remaining) {
    int totalEaten = number;
    int toEat = need;

    if (remaining >= toEat) {
        totalEaten += toEat;
        remaining -= toEat;
    } else {
        totalEaten += remaining;
        remaining = 0;
    }

    return {totalEaten, remaining};
}

