#include<vector>
#include<string>
#include<algorithm>
#include<stdlib.h>
using namespace std;

int do_algebra(vector<string> operato, vector<int> operand) {
    int result = operand[0]; // Start with the first operand

    // Iterate through the operators and operands
    for (size_t i = 0; i < operato.size(); i++) {
        string op = operato[i];
        int num = operand[i + 1]; // The next operand

        if (op == "+") {
            result += num;
        } else if (op == "-") {
            result -= num;
        } else if (op == "*") {
            result *= num;
        } else if (op == "//") {
            if (num != 0) { // Avoid division by zero
                result /= num;
            } else {
                throw invalid_argument("Division by zero is not allowed.");
            }
        } else if (op == "**") {
            result = pow(result, num); // Exponentiation
        } else {
            throw invalid_argument("Invalid operator.");
        }
    }

    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (do_algebra({"**", "*", "+"}, {2, 3, 4, 5}) == 37);
    assert (do_algebra({"+", "*", "-"}, {2, 3, 4, 5}) == 9);
    assert (do_algebra({"//", "*"}, {7, 3, 4}) == 8);
}

